const SFormTextArea = (props) => {
  return (
    <div className="form-group">
      <label>{props.labelName}</label>
      <textarea
        className="form-control"
        readOnly={props.readOnly}
        onChange={(e) => props.change(e, props.id)}
        value={props.value}
        rows={props.rows}
      >
        {props.children}
      </textarea>
    </div>
  );
};
export default SFormTextArea;
